import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import HomePage from './Components/HomePage/HomePage';
import Gallery from './Components/Adverts/AdvertsPage';
import Visitor from './Components/RegisterAdverts';
import showDate from './Components/Footer/LegalNotices';
import Footer from './Components/Footer/Footer';
import Navbar from './Components/Navbar/Navbar';
import { AdvertsProvider } from './Components/CtxAdverts';
import './Components/css/communCSS.css';

const App = () => {

  return (
    <Router>
      <div className="App" >
        <Navbar />
          <AdvertsProvider>
              <Switch>
              <Route exact path="/" component={HomePage} />
              <Route path="/gallery" component={Gallery} />
              <Route path="/visitor" component={Visitor} />
              <Route path="/showDate" component={showDate} />
            </Switch>
          </AdvertsProvider>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
